import Video from "../landing/video/Video";
import { useState } from "react";

const Main = () => {
  function Ocultar() {
    const [ocultar, setOcultar] = useState(false);
    const onClick = () => {
      setOcultar(true);
    };
    return (
      <div>
        <input type="submit" value="Ver Video" onClick={onClick} />
        {ocultar ? <Video /> : null}
      </div>
    );
  }

  return (
    <div className="jumbotron">
      <div className="caja">
        <h1 id="h1">KALYPSE</h1>
        <h2>Createur de combinaisons de plong√©e personnalisables</h2>
        <hr />
        <h3>MADE IN FRANCE</h3>
        <div className="cont_video">
          <button onClick={Ocultar} className="video">
            VIDEO
          </button>
        </div>
      </div>
    </div>
  );
};

export default Main;
